			if(isset($content['data']['policy_order_code'])&&!empty($content['data']['policy_order_code'])){
				$result = $this->addWarranty($content['data']);
				LogHelper::logs($content['data'],'Tk_issue','issue','yunda_issue');
				echo json_encode(['msg'=>$content['data'],'content'=>'出单成功','status'=>'200']);
			}else{
				echo json_encode(['msg'=>$content['data'],'content'=>'出单失败','status'=>'500']);
			}
		}
	}
	public function addWarranty($content)
	{
		if(!is_array($content)){
			$content = json_decode($content,true);
		}
		if(empty($content['policy_order_code'])){
			return false;
		}
		$union_order_code = $content['union_order_code'];
		$warranty_rule = WarrantyRule::where('union_order_code',$union_order_code)->first();
		DB::beginTransaction();
		try{//添加到保单表中，添加到关联表中
			$id = $warranty_rule->id;
			$union_order_code = $warranty_rule->union_order_code;
			$WarrantyRule = WarrantyRule::find($id);
			$warranty_res = Warranty::where('warranty_code',$content['policy_order_code'])->first();
			if(empty($warranty_res)){
				//添加保单
				$Warranty = new Warranty();
				$Warranty->warranty_code = $content['policy_order_code'];
				$Warranty->deal_type = 0;  //成交方式，线上成交
				$Warranty->premium= $WarrantyRule->premium;
//                $Warranty->start_time = $content->start_time??'';
//                $Warranty->end_time = $content->end_time??'';
				$Warranty->start_time = $content['start_time']??'';
				$Warranty->end_time = $content['end_time']??'';
				$Warranty->save();
				//中间表关联表单
				$WarrantyRule->warranty_id = $Warranty->id;
				$result = $WarrantyRule->save();
				if($Warranty->id&&$result){
					DB::commit();
					return $Warranty->id;
				}else{
					DB::rollBack();
					return false;
				}
			}else{
				//更新保单
				$Warranty = new Warranty();
				$Warranty->warranty_code = $content['policy_order_code'];
				$Warranty->deal_type = 0;  //成交方式，线上成交
				$Warranty->premium= $WarrantyRule->premium;
				//$Warranty->start_time = $content->start_time??'';
				//$Warranty->end_time = $content->end_time??'';
				$Warranty->start_time = $content['start_time']??'';
				$Warranty->end_time = $content['end_time']??'';
				$Warranty->update();
				//中间表关联表单
				$WarrantyRule->warranty_id = $warranty_res->id;
				$WarrantyRule_res = $WarrantyRule->update();
				//更新渠道操作表
				$ChannelOperate = new ChannelOperate();
				$ChannelOperate->issue_status = '200';
				$channel_res = $ChannelOperate->update();
				if($WarrantyRule_res||$channel_res){
					DB::commit();
					return $warranty_res->id;
				}else{
					DB::rollBack();
					return false;
				}
			}
		}catch (Exception $e){
			DB::rollBack();
			return false;
		}
	}
